import React from 'react'
import { AiOutlineDelete } from 'react-icons/ai';
import { BiEdit } from 'react-icons/bi';

const Todo = ({todo}) => {
  return (
    <ul>

    <li className='task'>
        <span>
            {todo.data}
        </span>
        <span>
            <AiOutlineDelete/>
        </span>
        <span>
            <BiEdit/>
        </span>
    </li>
    </ul>
  )
}

export default Todo
